      },
      "learnable": true,
      "source": "learnable"
    },
    "beta_three": {
      "description": "Sensitivity parameter for deviation below the participant's proportional share percentage based on token contributions (capturing aversion to inequality relative to contribution). Higher values mean offers below the proportional share are more strongly penalized.",
